import React from 'react';
import FloatInput from './FloatInput';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';

const Header = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

export default function Vector3Input(props) {
  return (
    <>
    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }}>
        <Grid item xs={2} sm={4} md={4} key={index}><Header>x</Header></Grid>
        <Grid item xs={2} sm={4} md={4} key={index}><Header>y</Header></Grid>
        <Grid item xs={2} sm={4} md={4} key={index}><Header>z</Header></Grid>

        <Grid item xs={2} sm={4} md={4} key={index}><FloatInput val={0}/></Grid>
        <Grid item xs={2} sm={4} md={4} key={index}><FloatInput val={0}/></Grid>
        <Grid item xs={2} sm={4} md={4} key={index}><FloatInput val={0}/></Grid>
        
      </Grid>
      </Box>
    <Stack direction="row" spacing={0}>
        <Header>x</Header>
        <Header>y</Header>
        <Header>z</Header>
    </Stack>
    <Stack direction="row" spacing={0}>
        <FloatInput val={0} label="x"/>
        <FloatInput val={0} label="y"/>
        <FloatInput val={0} label="z"/>
    </Stack>
    </>
  );
}
